import axios from "axios";

const baseUrl = "http://localhost:6060"

export const getAllNft = (): Promise<any> => {
    return new Promise(async (resolve, reject) => {
      try {
        const res = await axios.get(`${baseUrl}/metadatas`);
        resolve(res.data);
      }
      catch (err) {
        reject(err);
      }
    });
  }
